import React from "react";
import './styles/Projects.css'

const ProjectsSection = () => {
  const projects = [
    { id: 1, title: "nod", bgColor: "bg-gradient-to-r from-pink-500 to-blue-500" },
    { id: 2, title: "3D Art", bgColor: "bg-gradient-to-r from-green-500 to-blue-400" },
    { id: 3, title: "Medium 12pt", bgColor: "bg-gray-800" },
    { id: 4, title: "Apple Design", bgColor: "bg-gray-800" },
    { id: 5, title: "Textures", bgColor: "bg-gray-800" },
  ];

  return (
    <div className="projects-section bg-black text-white py-16 px-8">
      <h2 className="text-4xl font-bold text-center mb-12">Projects</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
        {projects.map((project) => (
          <div
            key={project.id}
            className={`project-card relative rounded-lg overflow-hidden h-56 flex items-center justify-center ${project.bgColor} transition-all duration-300 hover:scale-105`}
          >
            {/* Thumbnail Title */}
            <span className="text-xl font-semibold text-white z-10">{project.title}</span>

            {/* Overlay with button */}
            <div className="absolute inset-0 bg-black bg-opacity-50 opacity-0 hover:opacity-100 transition-all duration-300 flex items-center justify-center z-20">
              <button className="px-6 py-2 border border-white text-white rounded-full hover:bg-white hover:text-black transition-all duration-300">
                View Details
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProjectsSection;
